import React, { FC } from "react"

interface IProps {
    name: string;
    age: number
}

const ChildComponent : FC<IProps> = ({name, age}):JSX.Element =>{
    return(
        <div>
            name: {name}
            age: { age }
            "hello world!"
        </div>
    )
}

export default ChildComponent;
